    <style>
        body {
            margin: 0;
            padding: 0;
            font-family: sans-serif;
            background-color: #000000;
            color: #f0f0f0;
            display: flex;
            justify-content: center;
            align-items: center;
            height: 100vh;
            overflow: hidden;
            position: relative;
        }

        video {
            position: absolute;
            top: 50%;
            left: 50%;
            transform: translate(-50%, -50%);
            min-width: 100%;
            min-height: 100%;
            width: auto;
            height: auto;
            z-index: -1;
            filter: blur(10px);
        }

        .profile-container {
            text-align: center;
            border: 1px solid #444;
            border-radius: 10px;
            padding: 20px;
            background: linear-gradient(135deg, #000000, #1a1a1a);
            width: 90%;
            max-width: 450px;
            box-shadow: 0 0 20px 5px rgba(0, 0, 0, 0.5);
            position: relative;
            z-index: 1;
            animation: pulse 1s infinite;
        }

        .profile-pic {
            width: 150px;
            height: 150px;
            border-radius: 50%;
            border: 3px solid #555;
            animation: pulseColor 1s infinite;
        }

        @keyframes pulseColor {
            0%, 100% {
                border-color: #555;
                box-shadow: 0 0 10px rgba(85, 85, 85, 0.6);
            }
            50% {
                border-color: #ff4081;
                box-shadow: 0 0 20px rgba(255, 64, 129, 0.8), inset 0 0 10px rgba(255, 64, 129, 0.8);
            }
        }

        .name {
            font-size: 24px;
            margin: 10px 0;
            color: #ffffff;
        }

        .bio {
            font-size: 16px;
            color: #ffffff;
            margin-bottom: 20px;
            border-right: 2px solid #d4d4d4;
            white-space: nowrap;
            overflow: hidden;
            width: 0;
            animation: typing 4s steps(30, end) forwards, blink-caret 0.75s step-end 4s 4, caret-fade-out 1s forwards 7s;
        }

        @keyframes typing {
            from { width: 0; }
            to { width: 100%; }
        }

        @keyframes blink-caret {
            from, to { border-color: transparent; }
            50% { border-color: #d4d4d4; }
        }

        @keyframes caret-fade-out {
            from { border-color: #d4d4d4; }
            to { border-color: transparent; }
        }

        .socials {
            display: flex;
            flex-wrap: wrap;
            justify-content: center;
            gap: 15px;
        }

        .social-icon img {
            width: 54px;
            height: 54px;
            transition: transform 0.3s ease;
        }

        .social-icon:hover img {
            transform: scale(1.1);
        }

        @media (max-width: 500px) {
            .social-icon img {
                width: 44px;
                height: 44px;
            }
        }

        .dropdown {
            margin-top: 20px;
            text-align: left;
        }

        .dropdown h2 {
            cursor: pointer;
            margin: 0;
            padding: 10px;
            background-color: #333;
            border: none;
            text-align: center;
            font-size: 18px;
            transition: background-color 0.3s ease;
            border-radius: 10px;
        }

        .dropdown h2:hover {
            background-color: #444;
        }

        .dropdown-content {
            max-height: 0;
            overflow: hidden;
            background-color: #1a1a1a;
            padding: 0 15px;
            border-radius: 10px;
            transition: max-height 0.5s ease-in-out, padding 0.5s ease-in-out;
        }

        .dropdown-content ul {
            list-style-type: none;
            padding: 0;
            margin: 0;
        }

        .dropdown-content li {
            margin-bottom: 10px;
        }

        .dropdown-content a {
            color: #ff4081;
            text-decoration: none;
        }

        .dropdown-content a:hover {
            text-decoration: underline;
        }

        .dropdown-content.open {
            max-height: 200px;
            padding: 15px;
        }

        footer {
            position: absolute;
            bottom: 10px;
            width: 100%;
            text-align: center;
            color: #ffffff;
        }

        .circle {
            position: absolute;
            border-radius: 50%;
            pointer-events: none;
            animation: ripple 0.6s linear;
        }

        .circle-small {
            width: 10px;
            height: 10px;
        }

        .circle-medium {
            width: 20px;
            height: 20px;
        }

        .circle-large {
            width: 30px;
            height: 30px;
        }

        .circle-colorful {
            background: radial-gradient(circle, rgba(255, 0, 150, 1), rgba(0, 204, 255, 1));
        }

        @keyframes ripple {
            0% {
                transform: scale(0);
                opacity: 1;
            }
            100% {
                transform: scale(4);
                opacity: 0;
            }
        }

        @keyframes pulse {
            0%, 100% {
                transform: scale(1);
            }
            50% {
                transform: scale(1.1);
            }
        }

        .profile-container.jump {
            animation: jump 0.3s alternate ease-in-out;
        }

        @keyframes jump {
            0% {
                transform: translateY(0);
            }
            100% {
                transform: translateY(-20px);
            }
        }

        .glow {
            animation: glow 1.5s ease-in-out infinite alternate;
        }

        @keyframes glow {
            0% {
                text-shadow: 0 0 10px rgba(255, 255, 255, 0.5);
            }
            100% {
                text-shadow: 0 0 20px rgba(255, 255, 255, 1), 0 0 30px rgba(255, 0, 150, 1), 0 0 40px rgba(0, 204, 255, 1);
            }
        }
    </style>

    <script>
        function toggleDropdown() {
            var content = document.querySelector('.dropdown-content');
            content.classList.toggle('open');
        }

        function detectBeat(analyserNode) {
            var bufferLength = analyserNode.frequencyBinCount;
            var dataArray = new Uint8Array(bufferLength);
            analyserNode.getByteFrequencyData(dataArray);

            var average = dataArray.reduce((a, b) => a + b, 0) / bufferLength;
            return average > 180; // Adjust this threshold as per beat detection sensitivity
        }

        document.addEventListener('DOMContentLoaded', (event) => {
            var audio = document.getElementById('bgMusic');
            var audioContext = new (window.AudioContext || window.webkitAudioContext)();
            var analyser = audioContext.createAnalyser();
            var source = audioContext.createMediaElementSource(audio);
            source.connect(analyser);
            analyser.connect(audioContext.destination);
            analyser.fftSize = 256;

            var bufferLength = analyser.frequencyBinCount;
            var dataArray = new Uint8Array(bufferLength);

            function renderFrame() {
                requestAnimationFrame(renderFrame);
                analyser.getByteFrequencyData(dataArray);

                if (detectBeat(analyser)) {
                    // Trigger beat effects
                    document.querySelector('.profile-container').classList.add('jump');
                    document.querySelector('.profile-pic').classList.add('glow');
                    
                    var circle = document.createElement('div');
                    circle.className = 'circle circle-colorful circle-medium';
                    circle.style.left = (Math.random() * (window.innerWidth - 20)) + 'px';
                    circle.style.top = (Math.random() * (window.innerHeight - 20)) + 'px';
                    document.body.appendChild(circle);

                    setTimeout(function() {
                        circle.remove();
                    }, 600);
                } else {
                    // Reset effects when no beat detected
                    document.querySelector('.profile-container').classList.remove('jump');
                    document.querySelector('.profile-pic').classList.remove('glow');
                }
            }

            renderFrame();
        });

        document.addEventListener('mousemove', function(e) {
            var circle = document.createElement('div');
            circle.className = 'circle circle-colorful circle-medium';
            circle.style.left = (e.pageX - 15) + 'px';
            circle.style.top = (e.pageY - 15) + 'px';
            document.body.appendChild(circle);

            setTimeout(function() {
                circle.remove();
            }, 600);
        });
    </script>
